CREATE TABLE lista (ID CHAR (36) NOT NULL CHECK (length("ID") = 36), PRIORITATE SMALLINT (6) DEFAULT NULL CHECK (typeof(PRIORITATE) = 'integer'), DENUMIRE VARCHAR (25) DEFAULT NULL CHECK (length("DENUMIRE") <= 25), MAGAZIN VARCHAR (25) CHECK (length("MAGAZIN") <= 25) DEFAULT NULL, SCURT VARCHAR (3) DEFAULT NULL CHECK (length("SCURT") <= 3), DESCRIERE VARCHAR (20) DEFAULT NULL CHECK (length("DESCRIERE") <= 20), VALOARE DECIMAL (11, 2) DEFAULT (0) CHECK (typeof(VALOARE) = 'real' or typeof(VALOARE) = 'integer'), NEVOIE TINYINT (1) DEFAULT (0) CHECK (typeof(NEVOIE) = 'integer'), PERIOADA VARCHAR (15) DEFAULT NULL CHECK (length("PERIOADA") <= 15), DATA DATE CHECK (date(DATA) IS NOT NULL), ACTIV TINYINT (1) DEFAULT (0) CHECK (typeof(ACTIV) = 'integer'), O CHAR (1) NOT NULL CHECK (length("O") = 1), PRIMARY KEY (ID));INSERT INTO lista VALUES('30ADD48E-7676-11EA-8F09-00FF013B0A26', 1, 'hârtie.igi.aro.MTR', 'METRO', 'MTR', '1x40/14,28lei', 14.28, 0, '4. lună', '07.12.2020', 1, '-');
CREATE TABLE cheltuieli (ID CHAR (36) NOT NULL CHECK (length("ID") = 36), DENUMIRE varchar (25) DEFAULT NULL CHECK (length("DENUMIRE") <= 25), MAGAZIN VARCHAR (25) DEFAULT NULL CHECK (length("MAGAZIN") <= 25), DESCRIERE varchar (20) DEFAULT NULL CHECK (length("DESCRIERE") <= 20), AN smallint (6) DEFAULT NULL CHECK (typeof(AN) = 'integer'), LUNA smallint (6) DEFAULT NULL CHECK (typeof(LUNA) = 'integer'), ZIUA smallint (6) DEFAULT NULL CHECK (typeof(ZIUA) = 'integer'), VALOARE decimal (11, 2) DEFAULT (0.0) CHECK (typeof(VALOARE) = 'real' or typeof(VALOARE) = 'integer'), SEMN char (1) DEFAULT NULL CHECK (length("SEMN") <= 1));INSERT INTO cheltuieli VALUES('E7CE7E67-03C9-4DDF-80EF-E790A950197D', 'încăr.0753757937.ORG', 'ORANGE', '1incă/59,44lei', 2020, 12, 1, 59.44, '-');
